import React, { useState } from 'react'







const App=() => {
    const state=useState();
    const [count,setCount] = useState(0);
    
    
    
    
    const incNum=()=> {
        // console.log("clicked" + count++);
        setCount(100);
    };
    
    return(
        <>
        <div className="des">
        <h1>{count}</h1>
        <button onClick={incNum} >Click me</button> 
        </div>
        </>
    )
    

}

export default App;
